import React, { Component } from "react";

class Navbar extends Navbar{
    render(){
        return(
            <nav>
                <ul>
                    <li>Home</li>
                    <li>About Me</li>
                    <li>Portfolio</li>
                    <li>Resume</li>
                </ul>
            </nav>
        )
    }
}

export default Navbar
